Description:
キーの1つ1つにスイッチや金属製のバネを採用。打鍵するごとに独特な音と感触がするキーボードのこと。

通常のキーボードよりも値段が高く、その分長持ちするのが特徴。コストよりも性能を重視するユーザーが好む。
1つのキーを連続で押す動きに強いため、ゲーマーに愛されている傾向にある。

&nbsp;

参考画像：<a href="https://www.diatec.co.jp/products/CHERRY/">チェリー社製作キーボード</a>

&nbsp;

通常のキーボードと形状が異なるキーボード。

通常のものは、手首に負担がかかるため、長時間の作業には適さない。

キーボードの中央部が折れ曲げ、手首への負担を軽減する構造になっている。

&nbsp;

